import React from 'react'
import ReactDOM from 'react-dom'
import Login from "./containers/Login";
import axios from 'axios';
import DropdownButton from 'react-bootstrap/DropdownButton'
import Dropdown from 'react-bootstrap/Dropdown'

class Message extends React.Component{
    render(){
        return (
            <div>
                <h1 style = {{color: this.props.color}}>
                {this.props.msg}
                </h1>
                <p>
                    I'll check back in {this.props.minutes} minutes
                </p>
            </div>
        )
    }
}


class TickerList extends React.Component{
    constructor() {
        super()
    }
      componentWillMount() {
        this.getDataAxios()
    }

    async getDataAxios(){
        const response =
          await axios.get("http://localhost:8080/tickerList",
          { headers: {'Content-Type': 'application/json'}})
        console.log(response.data)
    }

    render(){
        return (
            <div>
                <p>Hello World</p>

            </div>
        )
    }
}

class Test extends React.Component{
    constructor() {
        super()
    }
    render(){
        return (
            <div>
                <p>Hello World</p>

                <Dropdown text='File' action='hide'>
        <Dropdown.Item text='New' />
        <Dropdown.Item text='Open...' description='ctrl + o' />
        <Dropdown.Item text='Save as...' description='ctrl + s' />
        <Dropdown.Item text='Rename' description='ctrl + r' />
        <Dropdown.Item text='Make a copy' />
        <Dropdown.Item icon='trash' text='Move to trash' />
        <Dropdown.Divider />
        <Dropdown.Item text='Download As...' />
        <Dropdown.Item text='Publish To Web'>
          <Dropdown.Menu>
            <Dropdown.Item text='Google Docs' />
            <Dropdown.Item text='Google Drive' />
            <Dropdown.Item text='Dropbox' />
            <Dropdown.Item text='Adobe Creative Cloud' />
            <Dropdown.Item text='Private FTP' />
            <Dropdown.Item text='Another Service...' />
          </Dropdown.Menu>
        </Dropdown.Item>
        {/* item text can also be defined as children */}
        <Dropdown.Item>E-mail Collaborators</Dropdown.Item>
      </Dropdown>

            </div>
        )               
    }
}

ReactDOM.render(
    //<Message color="blue" msg="How are you?" minutes={5} />,
    //<Login/>,
    //<TickerList/>,
    <Test/>,
    document.getElementById('root')
)
